webpackJsonp([0xefa82b83ad7],{3328:function(e,t){e.exports={data:{challengeNode:{title:"Problem 88: Product-sum numbers",description:["A natural number, N, that can be written as the sum and product of a given set of at least two natural numbers, {a1, a2, ... , ak} is called a product-sum number: N = a1 + a2 + ... + ak = a1 × a2 × ... × ak.","For example, 6 = 1 + 2 + 3 = 1 × 2 × 3.","For a given set of size, k, we shall call the smallest N with this property a minimal product-sum number. The minimal product-sum numbers for sets of size, k = 2, 3, 4, 5, and 6 are as follows.","k=2: 4 = 2 × 2 = 2 + 2k=3: 6 = 1 × 2 × 3 = 1 + 2 + 3k=4: 8 = 1 × 1 × 2 × 4 = 1 + 1 + 2 + 4k=5: 8 = 1 × 1 × 2 × 2 × 2  = 1 + 1 + 2 + 2 + 2k=6: 12 = 1 × 1 × 1 × 1 × 2 × 6 = 1 + 1 + 1 + 1 + 2 + 6","Hence for 2≤k≤6, the sum of all the minimal product-sum numbers is 4+6+8+12 = 30; note that 8 is only counted once in the sum.","In fact, as the complete set of minimal product-sum numbers for 2≤k≤12 is {4, 6, 8, 12, 15, 16}, the sum is 61.","What is the sum of all the minimal product-sum numbers for 2≤k≤12000?"],challengeType:5,fields:{slug:"/coding-interview-prep/project-euler/problem-88-product-sum-numbers",blockName:"Project Euler",tests:[{text:"<code>euler88()</code> should return 7587457.",testString:"assert.strictEqual(euler88(), 7587457, '<code>euler88()</code> should return 7587457.');"}]},required:[],files:{indexhtml:null,indexjs:{key:"indexjs",ext:"js",name:"index",contents:"function euler88() {\n  // Good luck!\n  return true;\n}\n\neuler88();",head:"",tail:""},indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/coding-interview-prep/project-euler/problem-89-roman-numerals",id:"5900f3c51000cf542c50fed6"},slug:"/coding-interview-prep/project-euler/problem-88-product-sum-numbers"}}}});
